          placeholder="Enter a number"
          onKeyUp={(e) => {
            let num = e.target.value;
            let isInteger = num % 1 !== 0
            if (num % 1 !== 0){
              Math.round(num);
              console.log(Math.round(num));
              console.log(inputNumber)
            }
            setInputNumber(num);
            // console.log(inputNumber);
          }}
        />
      </div>
